import React, { Component, Fragment } from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render () {
    return (
      <Fragment>
        <div className="App">
          <h1>React App</h1>
        </div>
        <h2>Mon Second titre</h2>
      </Fragment>
    )
  }
}

export default App;
